import React from 'react'
import NavBar from './NavBar';
import Cats from './Cats';
import { BrowserRouter as Router, Route, Switch} from 'react-router-dom';
function App() {
return (
  <Router>
    <div>
      <React.Fragment>
        <NavBar/>
      </React.Fragment>
      <div className='content'>
        <Switch>
          <Route path="/">
           <Cats/> 
          </Route>
        </Switch>
      </div>
    </div>
  </Router>
);


}

export default App;
